98 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 219.60 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 3.26 s &lt;/li&gt;\n&lt;li&gt; transfer time: 22.74 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.1.154:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 4 &lt;/li&gt;\n          &lt;li&gt; Threads: 96 &lt;/li&gt;\n          &lt;li&gt; Memory: 690.94 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport time\nfrom dask.distributed import performance_report, Client\nimport json \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr, timeout=60, heartbeat_interval=10)\n    return client\n\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n# Get client\nclient = connect(scheduler_info)\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    # Construct a lazy task graph \n    print(\"gt array\", gt, flush=True)\n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt)\n    print(\"result \", client.compute(s).result(), flush=True)       \n\nprint(\"Done in \", time.time() - t, flush=True)\nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"coordinates":null,"group":null,"text":"CPU"},"id":"1217","type":"Title"},{"attributes":{"line_alpha":0.2,"line_color":"red","x":{"field":"time"},"y":{"field":"read_bytes"}},"id":"1310","type":"Line"},{"attributes":{"format":"0.0 b"},"id":"1207","type":"NumeralTickFormatter"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"base":1024,"mantissas":[1,2,4,8,16,32,64,128,256,512]},"id":"1209","type":"AdaptiveTicker"},{"attributes":{},"id":"1454","type":"CategoricalTickFormatter"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1394"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1396"},"nonselection_glyph":{"id":"1395"},"view":{"id":"1398"}},"id":"1397","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"formatter":{"id":"1479"},"group":null,"major_label_policy":{"id":"1480"},"ticker":{"id":"1227"}},"id":"1226","type":"DatetimeAxis"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"axis":{"id":"1263"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1266","type":"Grid"},{"attributes":{},"id":"1455","type":"AllLabels"},{"attributes":{"start":0},"id"
